message:
Clean-up and restructuring

- Restructures SCSS code within the package (#2);
- Adds basic Grunt tasks (resolves #9);
- Updates NPM dependencies;

Add SVG icons along with their build toolkit

- [+] UI Icons added under `/icons/ui` in SVG and PNG versions;
- [+] `grunt-datauri` module for generating datauri components;
- [+] New task to `gruntfile.js` for generating `base64`-encoded datauri SVGs;
- [+] New SCSS component: `_icons.scss`;
- [+] Updated existing `build` and `dist` tasks to include icon generation;

Fixes #11

[Docs] Update SCSS building tasks

From now on, NPM-based Sass converter takes care of compiling SCSS for Jekyll, as it's more efficient and up-to-date.

- Upgrade `grunt-sass` and `node-sass` to latest stable versions;
- Update Grunt tasks for building SCSS for docs;
- Update Jekyll config to skip `_scss` directory;
- Move `docs/css/main.scss` to `_sass` dir;
- Ignore `docs/css` as it only required for builds;

Refs #13
Refs #14

Add and configure `grunt-pure-grids` package

- Optimised configuration for other tasks;
- Added `pure_grids` to the main build;

General cleanup

- Update npm dependencies;
- Cleanup configs;
- Optimise Grunt tasks;
- Update `readme.md`;

Build runtimes

- Update npm dependencies;
- Add `time-grunt` package to analyse build runtimes;

Add `responsive-nav.js` to the main build

- Update docs with new paths and info;
- Update docs templates;
- Add UglifyJS to Grunt;

Fixes #69

Update package manifests and `gruntfile.js`

- Remove `modularized-normalize-scss` package from `devDependencies`;
- Add `normalize-scss` package to `dependencies`;

From now on, this package relies on `grunt-wiredep` package to provide dependency hooks for WFP UI, or `grunt-sass` for SCSS dependencies.

All SCSS includes need to be declared locally (inside Grunt/Gulp task) for SCSS development.

Add `grunt-html-auditor` to the build

- Add accessibility, HTML5, and link testing (fix #60);
- Add special version of the task for Travis (with `showSummaryOnly` flag);

Testing Travis build failures

- This reverts commit 0a4a1c63d9458704c44e34e29752b7f18c04a6e5;
- Add `html-auditor` as a global package;
